import React, { useState } from "react";

const SignUp = () => {

    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");


    return (
        <div className="register">
            <h1>Register </h1>
            <input className="inputBox" type="text" placeholder="Enter Name" value={name} onChange={(e) => setName(e.target.value)} />
            <input className="inputBox" type="text" placeholder="Enter Email" value={email} onChange={(e) => setName(e.target.value)} />
            <input className="inputBox" type="text" placeholder="Enter Password" value={password} onChange={(e) => setName(e.target.value)} />
            <button className="appButton" type="button">SignUp</button>
        </div>
    )
}

export default SignUp;
